import React, { Component } from 'react';
import config from '../config';

class MenuReview extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: ''
        }
    }

    async componentDidMount() {
        const id = await config.methods.id().call()
        this.setState({
            id
        });
    }

    render() {
        return (
            <div className="main">
                <div className="ui card package">
                    <div className="content">
                        <div className="header">Package</div>

                        <div className="description">
                            <h3>ID:  {this.state.id} </h3>
                        </div>
                        <div className="description">
                            <h3>Name: </h3>
                        </div>
                        <div className="description">
                            <h3>Price: </h3>
                        </div>
                        <div className="description">
                            <h3>Details: </h3>
                        </div>
                    </div>
                    <div className="extra content">
                    </div>
                    <div>
                        <div>
                            <div><h4>Buyer recieve to purchese:</h4></div>
                            <div className="ui action input">
                                <input type="text" placeholder="Price" />
                                <button className="ui button">Deposit</button>
                            </div>
                        </div>
                        <div>
                            <div><h4>Buyer recieve to pur:</h4></div>
                            <div className="ui action input">
                                <input type="text" placeholder="Price" />
                                <button className="ui button">Deposit</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default MenuReview;
